def _indent_of(line):
    n = 0
    for c in line:
        if c != " ":
            break
        n += 1
    return n

def _preview(lines):
    joined = " ".join(x.strip() for x in lines if x.strip())
    ellipsis = "..."
    maxlen = 40
    if len(joined) <= maxlen:
        return joined
    else:
        return joined[: maxlen - len(ellipsis)] + ellipsis

